import api from "./baseApi";

export const groupApi = {
  getGroups(params, cancelToken) {
    return api.get("/api/group", { params, cancelToken });
  },
  getDetailGroups(params) {
    return api.get(`/api/group/${params.id}`, { params });
  },
  postGroup(payload) {
    return api.post("/api/group", payload);
  },
  putGroup(id, payload) {
    return api.put(`/api/group/${id}`, payload);
  },
  deleteGroup(groupId) {
    return api.delete(`/api/group/${groupId}`);
  },
};
